void propagateLayer2(const std::vector<float> &input, std::vector<float> &output)
{
  output.resize(input.size());
  for (unsigned i = 0; i < input.size(); ++i)
    output[i] = std::max(input[i],0.f);
}


void propagateLayer3(const std::vector<float> &input, std::vector<float> &output)
{
  // this is in order of indices
  const unsigned inputWidth = 23;
  const unsigned inputHeight = 7;

  const unsigned outputWidth = 11;
  const unsigned outputHeight = 3;

  const unsigned numPlanes = 64;

  assert(input.size() == numPlanes * inputWidth * inputHeight);

  output.resize(numPlanes * outputWidth * outputHeight);

  const int kernelHeight = 2;
  const int kernelWidth = 2;

  const int w_stride = 2;
  const int h_stride = 2;



  for (unsigned plane = 0; plane < numPlanes; ++plane)
  {
    // we have padding
    for (int i = 0; i < (int)outputWidth; ++i)
    {
      for (int j = 0; j < (int)outputHeight; ++j)
        {
          float theMax = - std::numeric_limits<float>::max();

          for (int di = 0; di < kernelWidth; ++di)
            {
              for (int dj = 0; dj < kernelHeight; ++dj)
                {
                  int ii = i * w_stride + di;
                  int jj = j * h_stride + dj;

                  // if (ii < 0 || jj < 0 || ii >= inputWidth || jj >= inputHeight)
                  //  // since we don't have padding
                  //  continue;

                  // note that height is the last index
                  float inputValue = input[plane * (inputWidth * inputHeight) + jj * inputWidth + ii];
                  theMax = std::max(theMax, inputValue);
                }
            }
          output[plane * (outputWidth * outputHeight) + j * outputWidth + i] = theMax;
        }
    }    
  } // loop over output planes
}
    

